Stunning graphics and a barrage of weapons and motorcycles to choose from make this the best one yet. Race through cities, mountains and tunnels as you stunt your wary to the finish line.
Compete in multiplayer mode and stunt against friends as you fight off the enemies to get the most points. Add a weapon like a chainsaw, flame thrower or mini gun to unleash on the other bikers and help you get the most points.
If your game lags, please turn off FX located inside Quality settings on Main Menu Options!
Each level contains many power up items, fill up the white bar under your health meter to have access to your weapons!

40 Customizable characters! 
Multiple bike setup!
Multiplayer modes!
Biker weapons including Baseball Bat and Chainsaw!
Special motorcycle attachments with flame thrower and mini gun!
Nine new levels including a free ride map!

